class Solution {
    func maximumScore(_ nums: [Int], _ k: Int) -> Int {
        let mod = 1_000_000_007
        var scores = [(score: Int, value: Int)]()
        for num in nums {
            scores.append((primeScore(num), num))
        }
        scores.sort { $0.score == $1.score ? $0.value > $1.value : $0.score > $1.score }

        var result = 1
        for i in 0..<min(k, scores.count) {
            result = (result * scores[i].value) % mod
        }
        return result
    }

    private func primeScore(_ num: Int) -> Int {
        var n = num
        var factors = Set<Int>()
        var factor = 2
        while factor * factor <= n {
            while n % factor == 0 {
                factors.insert(factor)
                n /= factor
            }
            factor += 1
        }
        if n > 1 {
            factors.insert(n)
        }
        return factors.count
    }
}
